import ebookImg from "../images/kindle.png";
import borrowedImg from "../images/borrow.png";
import heartImg from "../images/heart.png";
import BooksList from "../lists/BooksList";

export default function Main() {
    return(
        <>
            <div className="main">
               <Link to={"./BooksList"}><BooksList/>
                   <div className="books container">
                    <img src={bookImg} alt="książki"/>
                    <h2>książki</h2>
                    <p>sprawdź, co już masz na papierze</p>
                </div>
               </Link>
                <div className="books container">
                    <Link to="/EbooksList"><img src={ebookImg} alt="ebooki"/></Link>
                    <h2>ebooki</h2>
                    <p>sprawdź, co już masz na kindlu</p>
                </div>
                <div className="borrowed container">
                    <Link to="/BorrowedList"><img src={borrowedImg} alt="wypożyczone"/></Link>
                    <h2>wypożyczone</h2>
                    <p>zapisz, żeby nie zapomnieć</p>
                </div>
                <div className="wishlist container">
                    <Link to="/Wishlist"><img src={heartImg} alt="wishlist"/></Link>
                    <h2>wishlist</h2>
                    <p>zapamiętaj, co chcesz kupić</p>
                </div>
            </div>
            </>
